import './App.css';
import video from './video.mp4';
import { Text, View } from 'react-native';
function App() {
    let audio = new Audio("./music.mp3")

    const start = () => {
        audio.play()
    }
  return (
    <div className="App">
        <video className='videoTag' autoPlay loop muted>
            <source src={video} type='video/mp4'/>
        </video>

        < div >
            <button onClick={start}>Play</button>
        </div >
        );
    </div>

  );
}


export default App;
